import React from "react";  
import ReactDom from "react-dom";
let date = new Date();
let localDate = date.toLocaleDateString()
let localTime = date.toLocaleTimeString()
let img1 = 'https://picsum.photos/200'
let img2 = 'https://picsum.photos/300'
let img3 = 'https://picsum.photos/400'
ReactDom.render(
  <>
   <h1 contentEditable="true">My name is Akalesh Tanwer</h1>
   <p>{`Current Date  is ${localDate}`}</p>
   <p>{`Current Time  is ${localTime}`}</p>
   <img src={img1} />
   <img src={img3} />

   <img src={img2} />
  </>,
  document.getElementById('root')
);
